--	This code will fix your constraint to a deferred constraint for course
DECLARE
    v_constraint_name VARCHAR2(2000);
BEGIN
    SELECT
        constraint_name
    INTO v_constraint_name
    FROM
        user_constraints
    WHERE
        table_name = 'COURSE'
        AND constraint_type = 'R'
        AND r_constraint_name = (
            SELECT
                constraint_name
            FROM
                user_constraints
            WHERE
                constraint_type = 'P'
                AND table_name = 'COURSE'
        );

    EXECUTE IMMEDIATE 'ALTER TABLE COURSE DROP CONSTRAINT ' || v_constraint_name;
    EXECUTE IMMEDIATE 'ALTER TABLE COURSE ADD CONSTRAINT '
                      || v_constraint_name
                      || ' FOREIGN KEY (PREREQUISITE,PREREQUISITE_SCHOOL_ID) REFERENCES COURSE (COURSE_NO,SCHOOL_ID) DEFERRABLE INITIALLY DEFERRED ENABLE'
                      ;
END;
/

--	Disable all triggers
DECLARE
    CURSOR c_trigger IS
    SELECT
        trigger_name
    FROM
        user_triggers;

BEGIN
    FOR r_trigger IN c_trigger LOOP
        EXECUTE IMMEDIATE 'alter trigger '
                          || r_trigger.trigger_name
                          || ' disable';
    END LOOP;
END;
/

